import React, { Component } from "react";


import "./Landing.css";

class Landing extends Component {
  render() {
    return (
      <div id="bande" class="container-fluid">
        <div class="row">
          <div class="col-sm-3">
            <h1>
              LES ENFANTS
          </h1>
          </div>
          <div className="col-sm-3">un droit pour les pauvres</div>
          <div class="col-sm-6">

          </div>


          <div className="row">
            <div>
              <span class="red">Red</span>
            </div>
            <div>
              <span class="green">Green</span>
            </div>
            <div>
              <span class="blue">Blue</span>
            </div>

          </div>




        </div>
      </div>

    );
  }
}

export default Landing;
